To adjust the default naming to an existing database scheme use the toql attributes tables and columns on the struct. Possible values are CamelCase snake_case SHOUTY_SNAKE_CASE mixedCase #[derive(Toql)]
#[toql(tables="SHOUTY_SNAKE_CASE", columns="UpperCase")] struct UserRef { user_id: u32 full_name: String,
} is translated into SELECT UserId, FullName FROM USER_REF; Or use table an the struct and column on the fields. #[derive(Toql)]
#[toql(table="User")] struct UserRef { #[toql(column="id")] user_id: u32 full_name: String,
} is translated into SELECT id, full_name FROM User

